import React, { useState, useEffect } from 'react';
import './App.css';

// Import components
import BuilderPage from './components/BuilderPage';
import DataEntryPage from './components/DataEntryPage';
import ReportPreviewPage from './components/ReportPreviewPage';

// Main App component with navigation
function App() {
  const [currentPage, setCurrentPage] = useState('builder');

  // Navigation component
  const Navigation = () => (
    <nav className="nav">
      <h1>Patient Report Builder</h1>
      <div className="nav-links">
        <a 
          href="#" 
          className={`nav-link ${currentPage === 'builder' ? 'active' : ''}`}
          onClick={(e) => {
            e.preventDefault();
            setCurrentPage('builder');
          }}
        >
          Builder
        </a>
        <a 
          href="#" 
          className={`nav-link ${currentPage === 'data-entry' ? 'active' : ''}`}
          onClick={(e) => {
            e.preventDefault();
            setCurrentPage('data-entry');
          }}
        >
          Data Entry
        </a>
        <a 
          href="#" 
          className={`nav-link ${currentPage === 'preview' ? 'active' : ''}`}
          onClick={(e) => {
            e.preventDefault();
            setCurrentPage('preview');
          }}
        >
          Report Preview
        </a>
      </div>
    </nav>
  );

  return (
    <div className="App">
      <Navigation />
      <div className="container">
        {currentPage === 'builder' && <BuilderPage />}
        {currentPage === 'data-entry' && <DataEntryPage />}
        {currentPage === 'preview' && <ReportPreviewPage />}
      </div>
    </div>
  );
}

export default App;
